  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of the project was to contrast
  as population of Cliff Swallows and a population of Bank Swallows. Both populations
  had nests located in a gravel pit near refuge headquarters. The specific questions
  being answered (1) Are there diurnal differences between the two species with respect
  to the time spent near their nests and the time spent in their nests (presumably
  caring for young); (2) How old are their young; (3) What are the behavioral patterns
  between the two species, among each species and toward individuals of other species;
  and (4) Why are there so few Cliff Swallows and so many Bank Swallows.\",\n\t\"owner_org\":
